import React from "react";

export const ContactForm = ({
  name,
  setName,
  phone,
  setPhone,
  email,
  setEmail,
  handleSubmit
}) => {
  return (
    <div>
    <form onSubmit={handleSubmit}>
      

      <input type="text" value={name} onChange={setName}/>Name
      <input type="tel" value={phone} onChange={setPhone}/>Phone
      <input type="email" value={email} onChange={setEmail}/>Email

      <button type="submit">Submit</button>




    </form>
    
    
    
    </div>
  );
};
